import React from "react";
import { Card, CardActionArea, CardMedia, CardContent, Typography, CardActions, Button, makeStyles} from "@material-ui/core";
import {serverAdresse} from '../../../../config'
import { Property } from "../../../../generated/graphql";

interface Props {
    property: Property
}

const useStyles = makeStyles({
  root: {
    maxWidth: 240,
    height: 320,
  },
  media: {
    height: 140,
  },

});



export const PropertyCard: React.FC<Props> = (props) => {

  const classes = useStyles();

  const imageUrl = serverAdresse + props.property.images[0];
  console.log(imageUrl); 

   return (
    <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media} 
          image=  {imageUrl}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
                  {props.property.title}
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
                  {props.property.location}
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions style={{alignSelf: 'bottom'}}>
        <Button size="medium" color="primary">
          Share
        </Button>
      </CardActions>
  </Card>
   )
}
